import{_ as t,c as o,o as l,ah as r}from"./chunks/framework.PvdZnrZd.js";const c=JSON.parse('{"title":"Multivendor Marketplace:Seller configuration","description":"Learn about Seller configuration.","frontmatter":{"title":"Multivendor Marketplace:Seller configuration","description":"Learn about Seller configuration.","date":"2025-06-25T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/configuration/seller-configuration.md","filePath":"zenith/configuration/seller-configuration.md"}'),a={name:"zenith/configuration/seller-configuration.md"};function n(s,e,i,p,d,g){return l(),o("div",null,[...e[0]||(e[0]=[r('<p>In this section of the blog, you’ll find everything related to seller configurations. Manage all your seller settings seamlessly from this dedicated menu section</p><p>From here, you can allow your sellers to fulfill items, enable the option to auto-approve the added sellers, allow sellers to view customers&#39; details and much more.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerconfig-scaled.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerconfig-scaled.webp" alt=" seller configuration Multivendor Marketplace for Shopify by Webkul"></a></p><p>This Guide is dedicated to letting you aware of all the new Seller menu of the <a href="/zenith/introduction/">Multi-Vendor Marketplace App</a> for Shopify.</p><p>Please keep following and tracking the <strong>Seller Updates</strong> to know about all the updates in the app.</p><p>Have a look at the newly introduced and updated features of the Seller menu of Multi vendor Marketplace app for Shopify:</p><h3 id="update-seller-handle" tabindex="-1">Update Seller Handle <a class="header-anchor" href="#update-seller-handle" aria-label="Permalink to &quot;Update Seller Handle&quot;">​</a></h3><p>When a new seller gets registered to your marketplace, it creates a seller handle for the particular seller profile page that is same as the seller name.</p><p>Suppose your seller name is <strong>&quot;Test Vendor&quot;</strong>, a seller profile page link will be created for that seller with seller handle <strong>&quot;test-vendor&quot;</strong>.</p><p>By default, the seller name will be added as seller handle for respective seller.</p><p>But, we have provided an option in the app through which you can <strong>update the seller handle for your seller profile page</strong>.</p><p>To do this, visit the Multi-vendor admin panel&gt;&gt;Configuration&gt;&gt;Seller Configuration&gt;&gt;Enable the Update Seller Handle tab&gt;&gt;Save.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerhandle-scaled.webp" alt="download-8"></p><p>Now, visit the <strong>Sellers</strong> menu&gt;&gt;<strong>Seller Listing</strong> sub-menu&gt;&gt;<strong>Edit</strong> seller&gt;&gt;Enable the Update Seller Handle tab and edit the handle&gt;&gt;Save changes.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/updatehand.webp" alt="screenshot-sp-seller.webkul.com-2021.02.01-13_35_22"></p><p>This is how you can update seller handle in the app.</p><h3 id="restrict-seller-to-disable-feedback" tabindex="-1">Restrict Seller To Disable Feedback <a class="header-anchor" href="#restrict-seller-to-disable-feedback" aria-label="Permalink to &quot;Restrict Seller To Disable Feedback&quot;">​</a></h3><p>In the Multi-vendor Marketplace app, the customers will have the option to provide feedback to a seller from the seller profile page.</p><p>Now, by default, the seller feedback won&#39;t be visible until it is enabled by the seller. Once enabled, the seller feedback will appear on the seller profile page.</p><p>It can later be disabled from the seller panel.</p><p>Now, you can restrict your sellers to disable the &quot;Feedbacks received from the customers&quot; i.e <strong>Hide the &quot;Disable&quot; option</strong> on the seller end.</p><p>Visiting the Configuration&gt;&gt;<strong>Seller Configuration</strong> menu, disable the tab &quot;Restrict Seller To Disable Feedback&quot;. And disallow sellers to disable the seller feedbacks.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/restrictfeedback.webp" alt="Configuration-Admin-15"></p><p>As soon as you <strong>disable</strong> the above configuration, the sellers won&#39;t get the option to disable the feedback from their respective seller panels.</p><p>TAB DISABLED i.e. Restricted sellers to hide the feedbacks received from the customers.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/restrictfeedback.webp" alt="Configuration-Admin-16"></p><p>NO OPTION TO DISABLE FEEDBACK ON SELLER END</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/feedbackrest.webp" alt="Feedback-Seller-•-Multivendor-MarketPlace"></p><h3 id="seller-zip-code-on-seller-profile-page" tabindex="-1">Seller Zip code on Seller profile page <a class="header-anchor" href="#seller-zip-code-on-seller-profile-page" aria-label="Permalink to &quot;Seller Zip code on Seller profile page&quot;">​</a></h3><p>You can now display the seller zipcode with the seller&#39;s address on the seller profile page of your store.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Seller-Profile-%E2%80%93-lalit-store1-1200x597.png" alt="Seller-Profile-–-lalit-store1"></p><p>You can check the seller zipcode variable in the &quot;Edit Theme&quot; section in the app. Go to Sellers&gt;&gt;Seller Profile Page Settings&gt;&gt;Themes&gt;&gt;<strong>Learn More</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerzipcode-1.webp" alt="Seller-Profile-Theme-edit-Admin"></p><p>You can check the variables here:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/variablezipcode.webp" alt="Screenshot-2020-09-17T182325.932"></p><p><strong>Note</strong>:- The seller profile page theme code is editable only in Theme 1 &amp; Theme 4.<br><a href="https://marketplace-doc.webkul.com/zenith/seller/seller-Profile-Page-Settings.html" target="_blank" rel="noreferrer"><strong>Know More</strong></a></p><h3 id="publish-unpublish-seller-profile-page" tabindex="-1">PUBLISH/UNPUBLISH SELLER PROFILE PAGE <a class="header-anchor" href="#publish-unpublish-seller-profile-page" aria-label="Permalink to &quot;PUBLISH/UNPUBLISH SELLER PROFILE PAGE&quot;">​</a></h3><p>The Admin can now decide whether he wants the seller profile of an individual seller to show up on the frontend or not.</p><p>For this, visit Multivendor Admin Panel &gt; Sellers &gt; Seller Listing &gt; Edit Seller. On the following page, you&#39;ll this option. Refer:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerprofilepublish.webp" alt="Edit-Seller-Admin-1"></p><h3 id="informative-seller-dashboard" tabindex="-1">Informative Seller Dashboard <a class="header-anchor" href="#informative-seller-dashboard" aria-label="Permalink to &quot;Informative Seller Dashboard&quot;">​</a></h3><p>Much more informative dashboard showing Total Seller, Recent Orders and their fulfillment status and details of Total sales.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerdashboard.webp" alt="adwdwaw"></p><h3 id="restrict-seller-signup" tabindex="-1">Restrict Seller Signup <a class="header-anchor" href="#restrict-seller-signup" aria-label="Permalink to &quot;Restrict Seller Signup&quot;">​</a></h3><p>If you want to restrict new members to signup on your marketplace, you can enable the <strong>Restrict Seller Signup</strong> from the <strong>Seller Configuration</strong> page.</p><p>After enabling this feature, the <strong>Join Now</strong> button will be hidden from the <strong>seller login page</strong>. Refer:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/01/Login-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Login-•-Multivendor-MarketPlace"></p><p>Visit: <strong>Multivendor Admin Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Seller Configuration</strong>.</p><p>Here, you can enable the following functionality. Refer:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellersignup.webp" alt="Configuration-Admin-2"></p><p><strong>NOTE:</strong> The admin can still add new sellers from his own marketplace admin panel.</p><h3 id="seller-email-verification" tabindex="-1">Seller Email Verification <a class="header-anchor" href="#seller-email-verification" aria-label="Permalink to &quot;Seller Email Verification&quot;">​</a></h3><p>If a seller registered to your marketplace is somehow not verified or missed the email verification email can now be verified via the app.</p><p>Visit: <strong>Multivendor Admin Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Seller Configuration</strong>.</p><p>By enabling this option, the seller whose email is not verified after registration will get an email verification link on the seller dashboard.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellermail.webp" alt="screenshot-sp-seller.webkul.com-2021.07.02-17_15_06"></p><p>After enabling this option, if a seller&#39;s email is not verified, that seller will have the &quot;<strong>Email Verification Link</strong>&quot; on his/her seller dashboard.</p><p>Clicking on it, the seller will get redirected to another page and get their emails verified.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/04/Screenshot-87-1200x489.png" alt="dashboard"></p><p>With this feature, you can check if your newly registered seller is verified or not.<br> Go to the <strong>Seller Listing</strong> section and check the same.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/04/Screenshot-86-1200x461.png" alt="seller listing"></p><h3 id="seller-profile-page-banner" tabindex="-1">Seller Profile Page BANNER <a class="header-anchor" href="#seller-profile-page-banner" aria-label="Permalink to &quot;Seller Profile Page BANNER&quot;">​</a></h3><p>Now, the Seller profile page on the front end will have the banner for his shop. Both admin and seller can upload the banner from their respective panels.</p><p><strong><a href="/zenith/seller/seller-profile-page-settings.html">Click here</a></strong> for a detailed blog on the new seller profile page.</p><p>You can upload a default banner for the sellers to be displayed on the &quot;Seller Profile Page Settings&quot; section of the app.</p><p>Admin Panel&gt;&gt;Sellers&gt;&gt;Seller Profile Page Settings&gt;&gt;Upload Banner (either Image or Video)&gt;&gt;Save Changes.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerbannerstorefront.webp" alt="Marketplace144"></p><p>The banner showing on the seller profile page:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerbanneradmin.webp" alt="Seller Store Banner "></p><p>In case you require this newly changed version of the seller profile page, do let us know as we are not updating it on every shop by default.</p><h3 id="video-on-the-seller-profile-page" tabindex="-1">Video on the Seller Profile page <a class="header-anchor" href="#video-on-the-seller-profile-page" aria-label="Permalink to &quot;Video on the Seller Profile page&quot;">​</a></h3><p>If you thought it was amazing to have banners on the seller profile page, then our new upgrade will make you feel extremely good.</p><p>Yes, now you and your sellers can add the video on the place of the banner on the seller’s profile page.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellervideo.webp" alt="Marketplace100"></p><p>Let’s know more about Multivendor Marketplace Seller Profile Video Feature.<br><strong><a href="https://webkul.com/blog/shopify-multivendor-marketplace-seller-profile-video-feature-new-theme/" target="_blank" rel="noreferrer">Click here</a></strong> for details.</p><p>Seller Profile Page showing Video Banner:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Seller-Profile-%E2%80%93-multivendor-marketplace-5-2.png" alt="adawd"></p><h3 id="seller-rating-star-color" tabindex="-1">Seller Rating Star Color <a class="header-anchor" href="#seller-rating-star-color" aria-label="Permalink to &quot;Seller Rating Star Color&quot;">​</a></h3><p>You can now select the <strong>color of the rating star</strong> given to your sellers in the Multivendor app from the “Seller Profile Page Settings” menu.</p><p>Once the rating is given by the customers to your seller, the seller can view it on his profile page.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerstarrating.webp" alt="seller rating star color"></p><p>You as an admin can select the color of the rating star and view it on the Seller profile page.</p><p>Follow the procedure to set the rating star color:</p><p>Admin panel &gt;&gt; Sellers &gt;&gt; Sellers Profile Page Settings (from the drop-down menu) &gt;&gt; “Seller Rating Star Color” &gt;&gt; Select the “Start color” and “End color” of the star &gt;&gt; Click on “Save” button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Seller-Profile-%E2%80%93-Demo-Store-1.png" alt="adsda"></p><h3 id="default-sort-by-for-seller-profiles" tabindex="-1">Default “Sort By” for Seller Profiles <a class="header-anchor" href="#default-sort-by-for-seller-profiles" aria-label="Permalink to &quot;Default “Sort By” for Seller Profiles&quot;">​</a></h3><p>This upgraded feature of the Multivendor app will help the admin to select the by default “Sort By” for the seller profile pages.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerfilter.webp" alt="adsd"></p><p>Once you set this from the “Seller Profile Page Settings” submenu, you can view it on the profile pages of your sellers.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Screenshot11.png" alt="dqDW"></p><h3 id="display-seller-s-store-logo-carousel-on-homepage" tabindex="-1">Display Seller&#39;s Store Logo Carousel on Homepage <a class="header-anchor" href="#display-seller-s-store-logo-carousel-on-homepage" aria-label="Permalink to &quot;Display Seller&#39;s Store Logo Carousel on Homepage&quot;">​</a></h3><p>You can now get an option to add a logo carousel to the home page of your store. For this, you need to follow the below-given steps:-</p><p>Go to the admin panel of the Multi-vendor app.</p><ul><li>Visit the <strong>Configuration</strong>.</li><li>Click <strong>Instruction for Marketplace</strong>.</li><li>Get the option to display the seller&#39;s store logo carousel.</li><li>Click the &quot;<strong>Generate</strong>&quot; button to generate liquid files on the Shopify end.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellerlogo.webp" alt="Instruction"></p><p>This will create a <strong>Seller Listing</strong> section in the theme editor of your Shopify store. So, add it to the homepage and drag &amp; drop the carousel anywhere on the home page.</p><p>Shopify backend&gt;&gt;Online Stores&gt;&gt;<strong>Theme</strong>&gt;&gt;<strong>Customize</strong> Theme&gt;&gt;<strong>Add</strong> Section&gt;&gt;Seller Listing appears (Sellers)&gt;&gt;<strong>Add</strong> it to the Homepage.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Screenshot-26-1200x599.png" alt="customize theme"></p><p>Now, the logos of all your seller&#39;s store will get displayed on the logo carousel of your home page.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/final-1200x957.png" alt="Seller&#39;s Logo"></p><p>That&#39;s all!</p><h3 id="mandatory-configurations-for-sellers" tabindex="-1">Mandatory Configurations for Sellers <a class="header-anchor" href="#mandatory-configurations-for-sellers" aria-label="Permalink to &quot;Mandatory Configurations for Sellers&quot;">​</a></h3><p>You can now restrict sellers to add products if the required details are not entered by the seller. These mandatory details include shipping details, payment details &amp; seller&#39;s account details.</p><p>So, to enable these restrictions in the app, you need to visit the Multi-vendor admin panel&gt;&gt;Configurations&gt;&gt;Seller Mandatory Steps.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellermandatoryconfig.webp" alt="Dashboard_Admin"></p><p>From here, You can set the options mandatory for your sellers:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellermandatorysteps.webp" alt="Seller_Mandatory_configuration_Admin"></p><ol><li><strong>SHIPPING DETAILS</strong></li></ol><p>From this option, you can restrict sellers to set at least one shipping method before they proceed to add the products.</p><p>You can restrict sellers to add at least 1 shipping method as default and add at least one shipping range.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/shippingdetails.webp" alt="Seller_Mandatory_configuration_Admin-1"></p><p><strong>2. PAYMENT DETAILS</strong></p><p>Also, make the option mandatory for sellers to configure at least one payment method from the seller panel to receive their earnings.</p><p>Now, once you enable this option, the seller will be able to add products only after configuring a payment method from their panel.</p><p><strong>3. SELLER &quot;MY ACCOUNT&quot; DETAILS</strong></p><p>From here, You can set mandatory &quot;My Account&quot; fields for the sellers.</p><p>Please Note:- Before enabling these fields here, make sure that these fields are enabled from the &quot;<strong>Seller Policy</strong>&quot; (normal &amp; advanced) and from the &quot;<strong>Seller Form Customization</strong>&quot; section of the app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/paymentdetails.webp" alt="Seller_Mandatory_configuration_Admin-2"></p><p>Thus, the sellers will be able to add products from their seller panels only after completing the above procedures (in case the admin has enabled these tabs &amp; make these options mandatory).</p><h3 id="customize-seller-login-sign-up-page" tabindex="-1">Customize Seller Login/Sign Up Page <a class="header-anchor" href="#customize-seller-login-sign-up-page" aria-label="Permalink to &quot;Customize Seller Login/Sign Up Page&quot;">​</a></h3><p>You can now edit the theme code of the seller login/sign up page. You can easily edit the theme template provided in the app and make the changes as per your requirements.</p><p>For this, Go to the Multi-vendor admin panel&gt;&gt;Visit <strong>Sellers</strong> menu&gt;&gt;Click &quot;<strong>Customize Seller Page</strong>&quot; sub-menu&gt;&gt;Select the <strong>Custom Page</strong> (Login Page or Sign up page)&gt;&gt;Get the template to edit the codes.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/07/Customize_Seller_Pages_Admin-1200x627.png" alt="Customize_Seller_Pages_Admin"></p><p>Now, select the custom page and click login or sign up page to edit the theme code provided.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/07/Customise_Seller_pages_Admin-1200x627.png" alt="Customise_Seller_pages_Admin"></p><p>This way, you can edit the theme codes to make the changes in the seller login &amp; sign up page.</p><h3 id="re-approve-seller-s-products" tabindex="-1">Re-approve Seller&#39;s Products <a class="header-anchor" href="#re-approve-seller-s-products" aria-label="Permalink to &quot;Re-approve Seller&#39;s Products&quot;">​</a></h3><p>You can now re-approve the seller&#39;s products in case the seller has done any changes in the products from his/her seller panel.</p><p>So, once a seller edits a product, the admin needs to approve the updates before they become live on the storefront.</p><p>For this, firstly you need to enable the tab from the <strong>Product Configuration</strong> menu in the app as shown in the screenshot:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/reapprove.webp" alt="Configuration-Admin-1"></p><p>Once the seller edits the product <strong>(except for the price, quantity, delivery days)</strong>.<br> Then you as an admin, will get an option to Re-approve the product from the product listing section.</p><p>You can either accept or deny the product re-approval request.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/reapproveadmin.webp" alt="Product-Admin"></p><p>Keep following this blog of ours to know about all the recent updates.</p><h3 id="advance-seller-feedback" tabindex="-1">Advance Seller Feedback <a class="header-anchor" href="#advance-seller-feedback" aria-label="Permalink to &quot;Advance Seller Feedback&quot;">​</a></h3><p>Now, the admin can define the points on which customers will give ratings to sellers on the seller profile page.</p><p>For example - if a customer gives a rating to the seller on the basis of product quality, product service, and product delivery.</p><p>Then the admin will create all 3 points in the admin panel and it will appear on the seller profile page, so that the customer can give star rating on basis of these 3 points.</p><p>For this, the first admin will go to configuration &gt;&gt; seller configuration &gt;&gt; enable &quot;ADVANCE SELLER FEEDBACK&quot; and click the &quot;save changes&quot; button below.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/restrictfeedback.webp" alt="Configuration-Admin"></p><p>Now, the admin will go to seller &gt;&gt; seller feedback option &gt;&gt; Click on &quot;Add feedback option&quot; button to add points for star rating given by customer.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/feedbackrest.webp" alt="Seller-Feedback-Option-Admin"></p><p>And on the seller profile page, it will be shown like the below image.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/02/Seller-Profile-%E2%80%93-Dipesh-Singh-Store1-1200x608.png" alt="Seller-Profile-–-Dipesh-Singh-Store1"></p><p>**Note:-<br> **The admin can create maximum 5 options or points for the star rating.<br> This feature is available for theme 1 and theme 4 only.</p><h3 id="seller-s-created-date-and-last-login-dates-on-the-seller-edit-page" tabindex="-1">Seller&#39;s &quot;Created Date&quot; and &quot;Last Login&quot; dates on the Seller Edit Page <a class="header-anchor" href="#seller-s-created-date-and-last-login-dates-on-the-seller-edit-page" aria-label="Permalink to &quot;Seller&#39;s &quot;Created Date&quot; and &quot;Last Login&quot; dates on the Seller Edit Page&quot;">​</a></h3><p>Now, the Admin can see the Seller&#39;s &quot;Created Date&quot; and &quot;Last Login&quot; date on the Seller Edit Page.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/07/screenshot_1690539190801-1200x315.png" alt="Seller Edit Page"></p><h3 id="sync-seller-data-to-shopify-metaobjects" tabindex="-1"><strong>Sync Seller data to Shopify MetaObjects</strong> <a class="header-anchor" href="#sync-seller-data-to-shopify-metaobjects" aria-label="Permalink to &quot;**Sync Seller data to Shopify MetaObjects**&quot;">​</a></h3><p>Admins can now easily sync seller data directly into Shopify using metaobjects.</p><p>This feature streamlines seller data management and ensures that all essential information is centrally accessible within the Shopify dashboard.</p><p><strong>How to Enable Seller Data Sync:</strong></p><p>Go to: Admin dashboard&gt;&gt;Configuration&gt;Seller configuration&gt;&gt;Enable Sync seller data in metaobjects.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/sellersyncdata-3.webp" alt="Seller data sync"></p><p>Once enabled, the system will automatically push seller details into Shopify&#39;s metaobject section.</p><p><strong>Note: The new seller created after enabling this configuration will be synced automatically.</strong></p><p><strong>However, to fetch the details of existing (old) sellers, you&#39;ll need to edit and save those sellers again; only then will the data be sent to Shopify.</strong></p><p>Where to View Synced Seller Data in Shopify:<br> After syncing, the admin can view seller data by navigating to:<br><strong>Shopify dashboard&gt;&gt;Content&gt;&gt;Metaobject&gt;&gt;Seller</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/sellerdata2-1200x569.webp" alt="Seller data"></p>',160)])])}const u=t(a,[["render",n]]);export{c as __pageData,u as default};
